    }

    return (
        <form onSubmit={handleSubmit}>
            <label>First name:
                <input
                    type="text"
                    value={firstName}
                    onChange={(e) => setfirstName(e.target.value)}
                />
            </label>
            <label>Last name:
                <input
                    type="text"
                    value={lastName}
                    onChange={(e) => setlastName(e.target.value)}
                />
            </label>
            <input type="submit" />
        </form>
    )
}

ReactDOM.render(<RegisterForm />, document.getElementById('root'));
